                         new WorkActivity{ ActivityID = 607, ActivityCode = "996", ActivityName = "MISCELLANEOUS ROUTINE MAINTENANCE"}
                    };
                    context.Database.ExecuteSqlCommand("SET IDENTITY_INSERT [dbo].[WorkActivities] ON;");
                    context.WorkActivities.AddRange(workactivities);
                    context.SaveChanges();
                    context.Database.ExecuteSqlCommand("SET IDENTITY_INSERT [dbo].[WorkActivities] OFF;");
                    transaction.Commit();
                }
            }
        }
    }
